    constructor(
        DAOFactory _daoFactory,
        ENS _ens,
        MiniMeTokenFactory _miniMeFactory,
        IFIFSResolvingRegistrar _aragonID
    ) public {
        require(
            isContract(address(_daoFactory)),
            ERROR_DAO_FACTORY_NOT_CONTRACT
