        bytes memory initializeData = abi.encodeWithSelector(
            Voting(0).initialize.selector,
            _token,
            _support,
            _acceptance,
            _duration
        );
        return
            Voting(_installNonDefaultApp(_dao, VOTING_APP_ID, initializeData));
    }

    function _createVotingPermissions(
        ACL _acl,
        Voting _voting,
        address _settingsGrantee,
        address _createVotesGrantee,
        address _manager
    ) internal {
        _acl.createPermission(
            _settingsGrantee,
            _voting,
            _voting.MODIFY_QUORUM_ROLE(),
            _manager
        );
        _acl.createPermission(
            _settingsGrantee,
            _voting,
            _voting.MODIFY_SUPPORT_ROLE(),
            _manager
        );
        _acl.createPermission(
            _createVotesGrantee,
            _voting,
            _voting.CREATE_VOTES_ROLE(),
            _manager
        );
    }

