    /* FINANCE */

    function _installFinanceApp(
        Kernel _dao,
        Vault _vault,
        uint64 _periodDuration
    ) internal returns (Finance) {
        bytes memory initializeData = abi.encodeWithSelector(
            Finance(0).initialize.selector,
            _vault,
