    /* TOKEN MANAGER */

    function _installTokenManagerApp(
        Kernel _dao,
        MiniMeToken _token,
        bool _transferable,
        uint256 _maxAccountTokens
    ) internal returns (TokenManager) {
        address _temAddr = _installNonDefaultApp(_dao, TOKEN_MANAGER_APP_ID);
        TokenManager tokenManager = TokenManager(_temAddr);

        _token.changeController(tokenManager);
        tokenManager.initialize(_token, _transferable, _maxAccountTokens);
        return tokenManager;
    }

    function _createTokenManagerPermissions(
        ACL _acl,
        TokenManager _tokenManager,
        address _grantee,
        address _manager
    ) internal {
        _acl.createPermission(
            _grantee,
            _tokenManager,
            _tokenManager.MINT_ROLE(),
            _manager
        );
        _acl.createPermission(
            _grantee,
            _tokenManager,
            _tokenManager.BURN_ROLE(),
            _manager
        );
    }

    function _mintTokens(
        ACL _acl,
        TokenManager _tokenManager,
        address[] memory _holders,
        uint256[] memory _stakes
    ) internal {
        _createPermissionForTemplate(
            _acl,
            _tokenManager,
            _tokenManager.MINT_ROLE()
        );
        for (uint256 i = 0; i < _holders.length; i++) {
            _tokenManager.mint(_holders[i], _stakes[i]);
        }
        _removePermissionFromTemplate(
            _acl,
            _tokenManager,
            _tokenManager.MINT_ROLE()
        );
    }

