        }
        _removePermissionFromTemplate(
            _acl,
            _tokenManager,
            _tokenManager.MINT_ROLE()
        );
    }

    function _mintTokens(
        ACL _acl,
        TokenManager _tokenManager,
        address _holder,
        uint256 _stake
    ) internal {
        _createPermissionForTemplate(
            _acl,
            _tokenManager,
            _tokenManager.MINT_ROLE()
        );
        _tokenManager.mint(_holder, _stake);
        _removePermissionFromTemplate(
            _acl,
            _tokenManager,
            _tokenManager.MINT_ROLE()
        );
    }

