    /* EVM SCRIPTS */

    function _createEvmScriptsRegistryPermissions(
        ACL _acl,
        address _grantee,
        address _manager
    ) internal {
        EVMScriptRegistry registry = EVMScriptRegistry(
            _acl.getEVMScriptRegistry()
        );
        _acl.createPermission(
            _grantee,
            registry,
            registry.REGISTRY_MANAGER_ROLE(),
            _manager
        );
        _acl.createPermission(
            _grantee,
            registry,
            registry.REGISTRY_ADD_EXECUTOR_ROLE(),
            _manager
        );
    }

    /* APPS */

    function _installNonDefaultApp(Kernel _dao, bytes32 _appId)
        internal
        returns (address)
    {
        return _installNonDefaultApp(_dao, _appId, new bytes(0));
    }

    function _installNonDefaultApp(
        Kernel _dao,
        bytes32 _appId,
        bytes memory _initializeData
    ) internal returns (address) {
        return _installApp(_dao, _appId, _initializeData, false);
    }

    function _installDefaultApp(Kernel _dao, bytes32 _appId)
        internal
        returns (address)
    {
        return _installDefaultApp(_dao, _appId, new bytes(0));
    }

    function _installDefaultApp(
        Kernel _dao,
        bytes32 _appId,
        bytes memory _initializeData
    ) internal returns (address) {
        return _installApp(_dao, _appId, _initializeData, true);
    }

    function _installApp(
        Kernel _dao,
        bytes32 _appId,
        bytes memory _initializeData,
        bool _setDefault
    ) internal returns (address) {
        address latestBaseAppAddress = _latestVersionAppBase(_appId);
        address instance = address(
            _dao.newAppInstance(
                _appId,
                latestBaseAppAddress,
                _initializeData,
                _setDefault
            )
        );
        emit InstalledApp(instance, _appId);
        return instance;
    }

    function _latestVersionAppBase(bytes32 _appId)
        internal
        view
        returns (address base)
    {
        Repo repo = Repo(PublicResolver(ens.resolver(_appId)).addr(_appId));
        (, base, ) = repo.getLatest();
    }

    /* TOKEN */

    function _createToken(
        string memory _name,
        string memory _symbol,
        uint8 _decimals
    ) internal returns (MiniMeToken) {
        require(
            address(miniMeFactory) != address(0),
            ERROR_MINIME_FACTORY_NOT_PROVIDED
        );
        MiniMeToken token = miniMeFactory.createCloneToken(
            MiniMeToken(address(0)),
            0,
            _name,
            _decimals,
            _symbol,
            true
        );
        emit DeployToken(address(token));
        return token;
    }

    function _ensureMiniMeFactoryIsValid(address _miniMeFactory) internal view {
        require(
            isContract(address(_miniMeFactory)),
            ERROR_MINIME_FACTORY_NOT_CONTRACT
        );
    }

    /* IDS */

    function _validateId(string memory _id) internal pure {
        require(bytes(_id).length > 0, ERROR_INVALID_ID);
    }

    function _registerID(string memory _name, address _owner) internal {
        require(address(aragonID) != address(0), ERROR_ARAGON_ID_NOT_PROVIDED);
        aragonID.register(keccak256(abi.encodePacked(_name)), _owner);
    }

    function _ensureAragonIdIsValid(address _aragonID) internal view {
        require(isContract(address(_aragonID)), ERROR_ARAGON_ID_NOT_CONTRACT);
    }

    /* HELPERS */

    function _toAddress(uint256 _value) private pure returns (address) {
        require(_value <= uint160(-1), ERROR_CANNOT_CAST_VALUE_TO_ADDRESS);
        return address(_value);
    }
